export interface ICreateBerry {
  body?: IAttributeBody
  clothes?: IAttributeClothes

  background?: IAttributeBackground
  faceAccessory?: IAttributeFaceAccessory
  hat?: IAttributeHat
  expression?: IIAttributeExpression

  size?: string
}


function pickRandomAttribute(enm: typeof IAttributeBody | typeof IAttributeClothes | typeof IAttributeBackground | typeof IAttributeFaceAccessory | typeof IAttributeHat | typeof IIAttributeExpression): IAttributeBody & IAttributeClothes {
  const propsLength = Object.keys(enm).length / 2
  const random = Math.floor(Math.random() * propsLength)
  const values = Object.values(enm)
  
  const newLocal = values[propsLength + random]
  return newLocal
}


export const $DisplayBerry = ({
  background, expression, faceAccessory, hat, clothes,
  size = '250px',
  body = IAttributeBody.BLUEBERRY
}: ICreateBerry) => component(() => [
  $svg('svg')(
    attr({ xmlns: 'http://www.w3.org/2000/svg', fill: 'none', viewBox: `0 0 1500 1500` }),
    style({ width: size, height: size })
  )(
    tap(({ element }) => {

      element.innerHTML = `
        ${svgPartsMapping.background[background || pickRandomAttribute(IAttributeBackground)]}
        ${svgPartsMapping.clothes[clothes || pickRandomAttribute(IAttributeClothes)]}
        ${svgPartsMapping.body[body || pickRandomAttribute(IAttributeBody)]}
        ${svgPartsMapping.expression[expression || pickRandomAttribute(IIAttributeExpression)]}
        ${svgPartsMapping.faceAccessory[faceAccessory || pickRandomAttribute(IAttributeFaceAccessory)]}
        ${svgPartsMapping.hat[hat || pickRandomAttribute(IAttributeHat)]}
      `
    })
  )()
])
